import React, { useState, useEffect } from "react";

const Admin = () => {
  const [report, setReport] = useState([]);

  useEffect(() => {
    fetch("http://localhost:5000/admin/report")
      .then((res) => res.json())
      .then((data) => setReport(data));
  }, []);

  return (
    <div>
      <h1>Admin Dashboard</h1>
      <table>
        <thead>
          <tr>
            <th>User ID</th>
            <th>Video 1 ID</th>
            <th>Video 2 ID</th>
            <th>Video 1 Rating</th>
            <th>Video 2 Rating</th>
            <th>Preferred Video ID</th>
          </tr>
        </thead>
        <tbody>
          {report.map((vote, index) => (
            <tr key={index}>
              <td>{vote.user_id}</td>
              <td>{vote.video1_id}</td>
              <td>{vote.video2_id}</td>
              <td>{vote.video1_rating}</td>
              <td>{vote.video2_rating}</td>
              <td>{vote.preferred_video_id}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Admin;
